    "High Temperature Fiberoptic Thermal Imaging System Project",nt"tracking_summary":
    {ntt"total": 3,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T03:48:12.016747",nt"name": "high-temperature-fiberoptic-thermal-imaging-system-project",nt"isopen":
    true,nt"url": null,nt"notes": "The proposed Phase 1 program will fabricate
    and demonstrate a small diameter single fiber endoscope that can perform high temperature
    thermal imaging in a jet engine turbine and combustor. Task work will design, fabricate,
    calibrate, and test the single fiber thermal imaging system in a 1000 C environment.
    Equipment needs will be documented in detail and system characteristics such as
    spatial and temporal resolution will be established. Feasibility will be established
    by demonstrating that a good thermal image of an illuminated high temperature target
    can be obtained. Imaging access to turbomachinery and combustors in during normal
    operation or even simple installation in a test rig would be an important advance
    in aircraft engine diagnosis. A prototype endoscope will be designed, fabricated,
    and tested in Phase 2.",nt"license_title": "U.S. Government Work",nt"extras":
